import './style.scss'

export default class QuizHost extends Component {

	componentWillMount(){
		fetchQuestions()
	}

	fetchQuestions(){
		 fetch('https://opentdb.com/api.php?amount=10&type=multiple')
		  .then((resp) => resp.json()) // Transform the data into json
		  .then(function(data) {
		    console.log(data)
		    })

	}

	render(){
		return(
			<div className="quizHostContainer">
			</div>
		)
	}
}
